import React from "react";
import Navbar from "./components/Navbar";
import Jumbotron from "./components/Jumbotron";
import Card from "./components/Card";
import Card2 from "./components/Card2";

function App() {
  return (
    <div className="container">
      <Navbar />
      <Jumbotron />
      <Card />
      <Card2 />
</div>
  );
}

export default App;
